import enum
from django.utils.functional import Promise
from django.utils.translation import gettext_lazy as _
from django.db import models


class ChoicesWithPropertiesMeta(models.enums.ChoicesMeta):
	def __new__(metacls, classname, bases, classdict, **kwds):
		labels = []
		for key in classdict._member_names:
			value = classdict[key]
			prop = None
			value, label, *prop = value

			if not prop:
				prop = {}
			else:
				prop = prop[0]

			value = tuple([value,label])

			labels.append({'label':label, 'props': prop})
			# Use dict.__setitem__() to suppress defenses against double
			# assignment in enum's classdict.
			dict.__setitem__(classdict, key, value)
		cls = super().__new__(metacls, classname, bases, classdict, **kwds)
		cls._value2label_map_ = dict(zip(cls._value2member_map_, labels))
		# Add a label property to instances of enum which uses the enum member
		# that is passed in as "self" as the value to use when looking up the
		# label in the choices.
		cls.label = property(lambda self: cls._value2label_map_.get(self.value)['label'])
		cls.props = property(lambda self: cls._value2label_map_.get(self.value)['props'])

		cls.do_not_call_in_templates = True
		return enum.unique(cls)

class ChoicesWithProperties(str, enum.Enum, metaclass=ChoicesWithPropertiesMeta):
	"""Class for creating string enumerated choices like django choices but with additional properties."""

	def __str__(self):
		"""
		Use value when cast to str, so that Choices set as model instance
		attributes are rendered as expected in templates and similar contexts.
		"""
		return str(self.value)

	def _generate_next_value_(name, start, count, last_values):
		return name


